import React, { Component } from "react";

class Navbar extends Component {
  openOption() {
    document.getElementById("myDropdown").classList.toggle("show");
  }

  render() {
    return (
      <React.Fragment>
        <div className="navbar">
          <div className="container">
            <div>
              <img
                className="logoimg"
                src="https://dx0qysuen8cbs.cloudfront.net/assets/core/logo-wordmark-horizontal-white-short-c309b91b96261a8a993563bdadcf22a89f00ebb260f4f04fd814c2249a6e05d4.svg"
                alt=""
              />
            </div>

            {/*<div className="userName">
              Kishore Raj<b className="caret"></b>
            </div>*/}

            <div className="dropdown">
              <button className="dropbtn" onClick={this.openOption}>
                Kishore Raj
                <i class="fa fa-caret-down"></i>
              </button>
              <div className="dropdown-content" id="myDropdown">
                <a href="#">Link 1</a>
                <a href="#">Link 2</a>
                <a href="#">Link 3</a>
              </div>
            </div>
          </div>
        </div>
        {/*
        <div>
            <button
              className="btn btn-primary"
              onClick={() => {
                auth.logout(() => this.props.history.push("/login"));
              }}
            >
              Logout
            </button>
        </div>
            */}
      </React.Fragment>
    );
  }
}

export default Navbar;
